import React from "react";
import styled from 'styled-components'

const Header = (props) => {
  return (
    <HeaderWrap>
      <Container>
        <h1>{props.title}</h1>
        <ul>
          <li>Inventory</li>
          <li>Available</li>
        </ul>
      </Container>
    </HeaderWrap>
  )
}

const HeaderWrap = styled.header`
  background: white;
  padding: 1rem 0rem;
  box-shadow: 2px 10px 30px #d7d7d7;
`;

const Container = styled.div`
  max-width: 900px;
  margin: 0 auto;
  position: relative;
  h1 {
    margin: 0rem 0rem 2rem 0rem;
  }
  ul {
    display: flex;
    list-style: none;
    margin: 1rem 0rem 0rem;
    padding: 0rem;
    li {
      margin-right: 1rem;
      text-transform: uppercase;
    }
  }
`;

export default Header;
